// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/Home';

import Game from './components/Game';
import About from './components/About';
import Header from './components/Header';

import Won from './components/Won'; // Importing the Won component
import Lost from './components/Lost'; // Importing the Lost component

import './App.css';

const App = () => {
  return (
    <Router>
      <div className="App">
        {/* Header Component */}
        <Header />

        {/* Content */}
        <div className="content">
          <Routes>
            <Route path="/" element={<Home />} /> {/* Default Route for Home.jsx */}
            <Route path="/home" element={<Home />} />
            <Route path="/game" element={<Game />} />
            <Route path="/about" element={<About />} />
            <Route path="/won" element={<Won />} /> {/* New Route for Won.jsx */}
            <Route path="/lost" element={<Lost />} /> {/* New Route for Lost.jsx */}
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
